    represent the total contributions  from individuals who have not individually
    contributed more than $200 in the aggregate during the calandar year.  9/22/2008
    \ In response to your 8/22/08 letter, I offer the following explanations.  The
    previous schedule A negative itemized entries were internal bookkeeping entries
    and should have been unitemized.  With the unitemization of these entries all
    Calendar Year-to-Date totals have been corrected.  Additionally, all entries on
    Schedule A are for contributors who have contributed over $200 in the aggregate
    during the calendar year.  There were no refunds to individuals during this reporting
    period and aggregates for individuals which exceed the $200 threshold were not
    deducted from column B.  Additionally, the Schedule E independent expenditure
    now shows the Pennsylvania as the state of the Primary election."
